interface IMainReducer {
  test: string;
}

export const InitialMainReducer: IMainReducer = {
  test: ''
};

export const main: any = (
  state: IMainReducer = InitialMainReducer,
  action: string
) => {
  switch (action) {
    case 'SHOW_ALL':
      return state.test;
    case 'SHOW_COMPLETED':
      return state.test;
    case 'SHOW_ACTIVE':
      return state.test;
  }
};
